import React from "react";
import EditSearch2 from "../EditSearch2";
import BasicSettings from "../BasicSettings";
import Frame3623 from "../Frame3623";
import "./Frame19543.css";

function Frame19543(props) {
  const { dashboard, editSearch2Props, basicSettingsProps, frame3623Props } = props;

  return (
    <div className="frame-19544">
      <div className="frame-36243">
        <div className="frame-36196 border-0-5px-quarter-spanish-white">
          <EditSearch2 editSearch={editSearch2Props.editSearch} className="edit-search3" />
        </div>
        <div className="frame-36204 border-0-5px-quarter-spanish-white">
          <BasicSettings basicSettings={basicSettingsProps.basicSettings} />
        </div>
        <div className="frame-36223 border-0-5px-quarter-spanish-white">
          <Frame3623
            admin={frame3623Props.admin}
            userUserProps={frame3623Props.userUserProps}
            className="frame-36232"
          />
        </div>
      </div>
      <div className="dashboard2 ibmplexsans-semi-bold-quarter-spanish-white-32px">{dashboard}</div>
      <div className="rectangle-64"></div>
    </div>
  );
}

export default Frame19543;
